import React from "react";

const SlotMachine = () => {
    const x = '⭐';
    const z = '⭐';
    const y = '⭐';

    if(x === y === z){
        return (
            <>
                <div className="slot-box">
                    <h1> {x} {y} {z}</h1>
                    <h1> This is Maching.</h1>
                    <hr />
                </div>
            </>
        );
    }
    else {
        return (
            <>
                <div className="slot-box">
                    <h1> {x} {y} {z}</h1>
                    <h1>This is Not Maching.</h1>
                    <hr />
                </div>
            </>
        );
    }

}
export default SlotMachine;
